import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Typography,
} from "@material-ui/core";
import "./Flight.module.css";

import { useState } from "react";
import { Modal, Button } from "antd";
import ModalFlight from "./ModalFlight";

function Flight() {
  const [isModalVisible, setIsModalVisible] = useState(false);

  const showModal = () => {
    setIsModalVisible(true);
  };

  const handleOk = () => {
    setIsModalVisible(false);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
  };
  return (
    <div className="wrapper">
      <h4>Kết quả tìm kiếm</h4>
      <Accordion>
        <AccordionSummary
          // expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1bh-content"
          id="panel1bh-header"
        >
          <div className="info">
            <div className="name">
              <img
                src="https://static.wixstatic.com/media/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg/v1/fill/w_1000,h_626,al_c,q_90,usm_0.66_1.00_0.01/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg"
                width="100px%"
                alt="logo-brand"
              />
              <br />
              <span style={{ fontSize: "18px" }}>VU780</span>
            </div>
            <div className="time">
              <h3>
                <div>
                  {/* <PlayCircleOutlined /> */}
                  07:35 - 09:10
                </div>
              </h3>
            </div>
          </div>
          <div className="price">
            <h5>ECONOMY</h5>
            <span>1,200,000 VNĐ</span>
            <br />
            <Button
              onClick={() => {
                setIsModalVisible(true);
              }}
            >
              Đặt vé
            </Button>
          </div>
        </AccordionSummary>

        <AccordionDetails>
          <Typography>Chi tiết chuyến bay</Typography>
          <br />
          <div className="detail">
            <div className="detail">
              <div className="detail-time">
                <div className="">
                  <Typography variant="h6">07:35</Typography>
                  <Typography variant="subtitle1">09/06/2022</Typography>
                </div>
                <div className="">
                  <Typography variant="h6">07:35</Typography>
                  <Typography variant="subtitle1">09/06/2022</Typography>
                </div>
              </div>
              <img src="https://data.vietnambooking.com/flight/icon_common/icon_from_to.png" />
              <div className="deatil-destination">
                <div className="">
                  Bay từ: Hồ Chí Minh (SGN) <br />
                  Sân bay: Sân bay quốc tế Tân Sơn Nhất
                </div>
                <br />
                <br />
                <div className="">
                  Bay đến: Hà Nội (HAN)
                  <br />
                  Sân bay: Sân bay quốc tế Nội Bài
                </div>
              </div>
            </div>
            <div className="deatail-flight">
              Hãng bay: Pacific Airlines Số hiệu: VN6008 Thời gian bay: 02h 45m
              Máy bay: 320
            </div>
          </div>
        </AccordionDetails>
      </Accordion>

      {isModalVisible && (
        <ModalFlight
          isModalVisible={isModalVisible}
          onOk={() => {
            setIsModalVisible(false);
          }}
          onCancel={() => {
            setIsModalVisible(false);
          }}
        />
      )}
    </div>
  );
}

export default Flight;
